import { useEffect, useState } from 'react';
import './App.css';
import UploadFiles from './components/UploadFiles';
import { database } from './configFirebase';

const databaseRef = database.ref('Audios');
function App() {
    const [audios, setAudios] = useState({
        src: '',
        image: '',
        title: 'Vui lòng chờ',
        artist: ''
    })
    useEffect(() => {
        async function fetchData() {
            try {
                databaseRef.once('value').then(res => {
                    const data = [];
                    const keys = Object.keys(res.val());
                    const values = Object.values(res.val());
                    keys.map((key, index) => {
                        values[index].id = key;
                        data.push(values[index]);
                        return data;
                    })
                })
            }
            catch (err) {
                console.log(err);
            }
        };
        fetchData();
    }, [])
    return (
        <div className="container-fluid">
            <div className="row no-gutters">
                <div className="col-9">
                </div>
                <div className="col-3">
                    <div className="wrapper-song">
                        <ul className="list-song">

                        </ul>
                    </div>
                </div>
            </div>

        </div>
    );
}

export default App;
